import { Card } from 'react-bootstrap'; 

function Home(){
    return (

        <Card className="bg-dark text-white">
            <Card.Img src="/bank.jpg" alt="Banking image" />
            <Card.ImgOverlay>
                <Card.Title>Welcome To BadBank</Card.Title>
                <Card.Text>
                    Let us help you with all your banking needs!
                </Card.Text>
            </Card.ImgOverlay>
        </Card>
    );
}

export default Home;
